INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (2834, 40, 7, "ペコリーヌとの出会い", 5118061, 2, 20063115, 8, 10118, "フリーマーケット会場", 1, 91002, 0, "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (2835, 40, 7, "マホとの出会い", 5118062, 2, 20063115, 8, 10118, "フリーマーケット会場", 1, 91002, 0, "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (2837, 40, 7, "アキノとの出会い", 5118063, 2, 20063115, 8, 10118, "ランドソル市街地", 1, 91002, 0, "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (4108402, 40, 18, "ジュンとの出会い", 5118064, 2, 20063115, 8, 10118, "フリーマーケット会場", 1, 91002, 0, "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (4107402, 40, 18, "カオリとの出会い", 5118065, 2, 20063115, 8, 10118, "フリーマーケット会場", 1, 91002, 0, "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (9000227, 40, 16, "ニノンとの出会い", 5118066, 2, 20063115, 8, 10118, "オーエド町", 1, 91002, 1, "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (2101181, 40, 19, "スズナとの出会い", 5118067, 3, 20063115, 8, 10118, "フリーマーケット会場", 1, 91002, 0, "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (4109402, 40, 18, "ナナカとの出会い", 5118068, 3, 20063115, 8, 10118, "ランドソル市街地", 1, 91002, 0, "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (4305402, 40, 18, "キャル＆コッコロとの出会い", 5118069, 3, 20063115, 8, 10118, "フリーマーケット会場", 1, 91002, 0, "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (4101402, 40, 18, "ユカリとの出会い", 5118070, 3, 20063115, 8, 10118, "ランドソル市街地", 1, 91002, 0, "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (4106402, 40, 18, "アオイとの出会い", 5118071, 3, 20063115, 8, 10118, "ランドソル市街地", 1, 91002, 0, "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (2836, 40, 7, "シノブとの出会い", 5118072, 3, 20063115, 8, 10118, "フリーマーケット会場", 1, 91002, 1, "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。");
INSERT INTO `v1_be1ad8e4ae3d4f352a5e7eb93d817a1a716b0926446369a60eb3be3bf686315b` VALUES (0, 0, 0, "オープニング", 5118600, 1, 20063115, 0, 10118, 0, 0, 0, 0, "彼女たちの新たな日常", 0);
